function Time()
{
    let greeting="";
    let cuti=new Date().toLocaleTimeString();
    if(cuti>=0 && cuti<12)
    greeting ="good morning";
    else if(cuti>=12 && cuti<19)
    greeting ="good afternon";
    else 
    greeting ="good night";

    <h1>hello sir/mam, <span>{greeting}</span></h1>

}
